import React from 'react';
import logo from './logo.svg';
import './App.css';



export class Accueil extends React.Component{
    constructor(props) {
        super(props);
    }
    render() {
        return <p>bonjour, je suis la page d accueil</p>;
    }
}
export class Configuration extends React.Component{
    constructor(props) {
        if (props!=null){
            this.state=props
        }
        else {
            this.state="";
        }
        super(props);
    }
    render() {
        return super.render(<p>bonjour, je suis la page de configuration</p>);
    }
}
export class Apropos extends React.Component{
    constructor(props) {
        super(props);
    }
    render() {
        return super.render(<p>bonjour, je suis la page de notre equipe</p>);
    }
}

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>

        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
        <body>
        <h1> Our App</h1>
            <div id="root">
                <script type="text/babel">
                    ReactDOM.render(<Accueil />,
                    document.getElementById('root'));
                </script>
            </div>
        </body>
    </div>
  );
}

export default App;
